**Describe the issue**
Tracing agent stores non existent classes like ArrowButton into reflect-config.json configuration file.

**Steps to reproduce the issue**
1. Create SwingSample.java file:
```
import javax.swing.*;
import java.awt.*;

public class SwingSample {
    public static void main(String[] args) throws Exception {

        final String lafName = "nimbus";

        System.out.printf("Use L&F: %s%n", lafName);

        SwingUtilities.invokeAndWait(() -> {
            try {
                UIManager.LookAndFeelInfo[] infos = UIManager.getInstalledLookAndFeels();
                for (UIManager.LookAndFeelInfo info : infos) {
                    System.out.printf("installed L&F: %s, class: %s%n", info.getName(), info.getClassName());
                    if (info.getName().toLowerCase().contains(lafName)) {
                        System.out.printf("  set L&F: %s%n", lafName);
                        UIManager.setLookAndFeel(info.getClassName());
                    }
                }
            } catch (Exception e) {
                throw new RuntimeException(e);
            }


            JFrame frame = new JFrame("Hello World");

            JButton button = new JButton("Hello");
            button.addActionListener(e -> {
                System.out.printf("Hello, World!%n");
            });

            JPanel panel = new JPanel(new FlowLayout());
            panel.add(button);

            frame.add(panel);
            frame.setSize(400, 300);
            frame.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);
            frame.setVisible(true);
        });
    }
}
```

2. Use tracing agent to generate config files for SwingSample application:
```
graalvm-ce-java19-22.3.0/bin/java -agentlib:native-image-agent=config-output-dir=conf-dir  SwingSample
```

The conf-dir/reflect-config.json file contains classes like:
```
[
{
  "name":"ArrowButton"
},
{
  "name":"Button"
},
{
  "name":"CheckBox"
},
```


**Describe GraalVM and your environment:**
 - GraalVM  **graalvm-ce-java19-22.3.0** from  https://github.com/graalvm/graalvm-ce-builds/releases/tag/vm-22.3.0 page.
 - OS: **Ubuntu 20.04.2 LTS**
 - Architecture: **x86_64**


**More details**
Building the native image for the Swing application with the generated configuration files produces a lot of warnings:
```
graalvm-ce-java19-22.3.0/bin/native-image -Djava.awt.headless=false -H:JNIConfigurationFiles=conf-dir/jni-config.json -H:ReflectionConfigurationFiles=conf-dir/reflect-config.json -H:ResourceConfigurationFiles=conf-dir/resource-config.json -H:SerializationConfigurationFiles=conf-dir/serialization-config.json SwingSample
========================================================================================================================
GraalVM Native Image: Generating 'swingsample' (executable)...
========================================================================================================================
Warning: Could not resolve ArrowButton for reflection configuration. Reason: java.lang.ClassNotFoundException: ArrowButton.
Warning: Could not resolve Button for reflection configuration. Reason: java.lang.ClassNotFoundException: Button.
Warning: Could not resolve CheckBox for reflection configuration. Reason: java.lang.ClassNotFoundException: CheckBox.
Warning: Could not resolve CheckBoxMenuItem for reflection configuration. Reason: java.lang.ClassNotFoundException: CheckBoxMenuItem.
Warning: Could not resolve ColorChooser for reflection configuration. Reason: java.lang.ClassNotFoundException: ColorChooser.
Warning: Could not resolve ComboBox for reflection configuration. Reason: java.lang.ClassNotFoundException: ComboBox.
Warning: Could not resolve DesktopIcon for reflection configuration. Reason: java.lang.ClassNotFoundException: DesktopIcon.
```

